INSERT INTO `plos` (`plo_id`, `description`, `ploName`, `program_id`, `isDelete`, `createdAt`, `updatedAt`) VALUES
(1, 'Vận dụng kiến thức cơ bản về khoa học tự \nnhiên, khoa học xã hội, khoa học chính trị \nvà pháp luật để giải quyết vấn đề liên quan \nchuyên ngành. ', 'IT_PLO1', 1, 0, '2024-05-06 16:51:03', '2024-06-24 13:38:11'),
(2, 'Kết hợp kiến thức chuyên môn để giải \nquyết các vấn đề liên quan chuyên ngành', 'IT_PLO2', 1, 0, '2024-05-06 16:51:03', '2024-06-24 13:38:15'),
(3, 'Phân tích các vấn đề tính toán phức tạp, áp \ndụng các nguyên lý của máy tính và  kiến \nthức liên quan khác để xác định các giải \npháp. ', 'IT_PLO3', 1, 0, '2024-05-06 16:51:03', '2024-06-24 13:38:18'),
(4, 'Thiết kế, cài đặt, triển khai và đánh giá các \ngiải pháp dựa trên máy tính để đáp ứng yêu \ncầu thực tế.', 'IT_PLO4', 1, 0, '2024-05-06 16:51:03', '2024-06-24 13:38:21'),
(5, 'Kết hợp các giải pháp có tính hệ thống để \nlựa chọn, phát triển, áp dụng, tích hợp và \nquản trị an toàn các hệ thống công nghệ \nthông tin nhằm đạt được các mục tiêu của \nngười dùng.', 'IT_PLO5', 1, 0, '2024-05-06 16:51:03', '2024-06-24 13:38:24'),
(6, 'Sử dụng tốt tiếng Anh trong soạn thảo, đọc \ntài liệu và giao tiếp, đạt bậc 4/6 theo khung \nnăng lực ngoại ngữ của Việt Nam. ', 'IT_PLO6', 1, 0, '2024-05-06 16:51:03', '2024-06-24 13:38:27'),
(7, 'Phối hợp tốt các kỹ năng giao tiếp trong \nbối cảnh nghề nghiệp.', 'IT_PLO7', 1, 0, '2024-05-06 16:51:03', '2024-06-24 13:38:29'),
(8, 'Phối hợp hiệu quả các kỹ năng làm việc \nnhóm với tư cách là thành viên hoặc người \nlãnh đạo ', 'IT_PLO8', 1, 0, '2024-05-06 16:51:03', '2024-06-24 13:38:31'),
(9, 'Coi trọng trách nhiệm nghề nghiệp để đưa \nra các đánh giá chuyên môn dựa trên \nchuẩn mực đạo đức và pháp luật. ', 'IT_PLO9', 1, 0, '2024-05-06 16:51:03', '2024-06-24 13:38:33'),
(10, 'Coi trọng sự cần thiết của quá trình học tập \nsuốt đời. ', 'IT_PLO10', 1, 0, '2024-05-06 16:51:03', '2024-06-24 13:38:35');
INSERT INTO `pos` (`po_id`, `description`, `poName`, `program_id`, `isDelete`, `createdAt`, `updatedAt`) VALUES
(1, 'Có kiến thức cơ bản về khoa học xã hội, khoa học chính trị, pháp luật, ngoại \nngữ, có tinh thần trách nhiệm và ý thức tổ chức kỷ luật tốt.', 'IT_PO1', 1, 0, '2024-05-06 16:49:57', '2024-06-24 13:37:13'),
(2, 'Có kiến thức và kỹ năng chuyên môn trong lĩnh vực công nghệ thông tin, \r\nđáp ứng yêu cầu của cách mạng công nghiệp 4.0.', 'IT_PO2', 1, 0, '2024-05-06 16:49:57', '2024-06-24 13:37:40'),
(3, 'Có khả năng làm việc hiệu quả trong lĩnh vực công nghệ thông tin, tạo ra \r\nnhững đóng góp tích cực cho xã hội.', 'IT_PO3', 1, 0, '2024-05-06 16:49:57', '2024-06-24 13:37:45'),
(4, 'Có khả năng làm việc độc lập hoặc làm việc theo nhóm, hướng dẫn, giám \nsát những người khác thực hiện nhiệm vụ trong lĩnh vực công nghệ thông tin.', 'IT_PO4', 1, 0, '2024-05-06 16:49:57', '2024-06-24 13:37:50'),
(5, 'Có khả năng khám phá tri thức, giải quyết vấn đề, tư duy hệ thống, phát triển \nphẩm chất cá nhân và nghề nghiệp thông qua hoạt động học tập suốt đời.', 'IT_PO5', 1, 0, '2024-05-06 16:49:57', '2024-06-24 13:37:56');
INSERT INTO `programs` (`program_id`, `programName`, `description`, `isDelete`, `createdAt`, `updatedAt`) VALUES
(1, 'Công nghệ thông tin', '<p><strong>Trình độ đào tạo:</strong> Đại học</p><p><strong>Mã ngành đào tạo:</strong> 7480201</p><p><strong>Loại hình đào tạo:</strong> Chính quy</p><p><strong>Số tín chỉ yêu cầu:</strong> 150</p><p><strong>Thời gian đào tạo:</strong> 4 năm</p><p><strong>Đối tượng tuyển sinh:</strong> Theo Quy định của Bộ Giáo dục và Đào tạo và Quy định của Trường Đại học Trà Vinh</p><p><strong>Thang điểm:</strong> Theo quy định của Trường Đại học Trà Vinh</p><p><strong>Điều kiện tốt nghiệp:</strong> Theo quy định</p><p><strong>Văn bằng tốt nghiệp:</strong> Kỹ sư</p><p><strong>Chương trình đào tạo chuẩn tham khảo:</strong></p><p> i. Chương trình đào tạo Cử nhân ngành Công nghệ Thông tin của Trường Đại học Công nghệ Thông tin, Đại học quốc gia Tp. HCM.</p><p> ii. Chương trình đào tạo Cử nhân ngành Công nghệ Thông tin của Trường Đại học Khoa học Tự nhiên, Đại học quốc gia Tp. HCM.</p><p> iii. Chương trình đào tạo Cử nhân ngành Công nghệ Thông tin của Trường Đại học Georgia Southern.</p><p> iv. Chương trình đào tạo Cử nhân ngành Công nghệ Thông tin của Trường Đại học California State University, Northridge.</p><p> v. Chương trình đào tạo cử nhân Công nghệ Thông tin theo khuyến nghị của Association for Computing Machinery (ACM).</p><p></p>', 0, '2024-05-06 16:46:57', '2024-06-03 08:57:15');
