(1, 7, 13, '<p>1. Mô tả bài toán cho ứng dụng minh họa rõ ràng, cụ thể </p><p>2. Xác định rõ yêu cầu, mô tả từng chức năng 04</p><p>3. Đề xuất mô hình dữ liệu phù hợp với mô tả và yêu cầu bài toán </p><p>4. Đề xuất mô hình xử lý phù hợp với mô tả và yêu cầu bài toán</p>', 1.00, 0, '2024-05-07 14:10:11', '2024-07-09 13:21:44', 1, 4, 1),
(23, 3, 1, '<p>1. Định dạng văn bản đúng quy định (font, size, khỗ giấy, canh lề, văn bản, định dạng đoạn,...)</p><p>2. Có mục lục, danh mục hình ảnh, bảng (nếu có), danh mục từ viết tắt (nếu có), danh mục tài liệu tham khảo</p><p>3. Văn phong rõ ràng, mạch lạc, không lỗi chính tả</p><p>4. Sử dụng tài liệu tham khảo chính thống, có trích dẫn rõ ràng </p>', 1.00, 0, '2024-05-09 18:37:57', '2024-07-09 13:20:59', 1, 7, 1),
(24, 4, 11, '<p>1. Đặt vấn đề (lý do chọn đề tài): rõ ràng, dẫn nhập có liện quan trực tiếp đến đề tài</p><p>2. Mục tiêu nghiên cứu: cụ thể, có khả năng thực hiện được.</p><p>3. Phương pháp nghiên cứu: cụ thể, rõ ràng, công cụ/thiết bị thực hiện phù hợp với nội dung đề tài</p><p>4. Đối tượng và phạm vi nghiên cứu: Đúng đối tượng và phạm vi nghiên cứu </p>', 1.00, 0, '2024-05-09 18:48:21', '2024-07-09 13:21:41', 1, 3, 1),
(25, 6, 12, '<p>1. Trình bày tổng quan các kiến thức chung có sử dụng trong đề tài </p><p>2. Trình bày cơ sở lý thuyết chuyên môn có liên quan đến đề tài; hoặc lịch sử hình thành và phát triển của ngôn ngữ/công nghệ/công cụ đã tìm hiểu.</p><p>3. đề tài Trình bày lý thuyết về nghiệp vụ liên quan đến </p><p>4. Trình bày các công trình nghiên cứu liên quan hoặc so sánh với các công nghệ cùng lĩnh vực tìm hiểu </p>', 1.00, 0, '2024-05-09 18:49:36', '2024-07-09 13:21:38', 1, 3, 1),
(28, 7, 13, '<p>1. Mô tả bài toán cho ứng dụng minh họa rõ ràng, cụ thể </p><p>2. Xác định rõ yêu cầu, mô tả từng chức năng 04</p><p>3. Đề xuất mô hình dữ liệu phù hợp với mô tả và yêu cầu bài toán </p><p>4. Đề xuất mô hình xử lý phù hợp với mô tả và yêu cầu bài toán</p>', 1.00, 0, '2024-05-10 08:31:30', '2024-05-14 05:20:38', 1, 4, 1),
(29, 6, 14, '<p>1. Thiết kế giao diện với màu sắc hài hòa</p><p>2. Giao diện có thực đơn phù hợp với các yêu cầu bài toán </p><p>3. Giao diện chức năng phù hợp với yêu cầu bài toán</p><p>4. Xây dựng chức năng lưu trữ hoàn chỉnh theo mô tả</p>', 1.00, 0, '2024-05-10 08:31:50', '2024-05-14 05:20:59', 1, 4, 1),
(30, 3, 14, '<p>1. Các chức năng cập nhật dữ liệu hoạt động ổn định (nếu có) </p><p>2. Các chức năng tương tác tốt với CSDL (nếu có), đảm bảo các ràng buộc toàn vẹn và ràng buộc dữ liệu (nếu có)</p><p>3. Xây dựng chức năng tra cứu tiện dụng, đáp ứng được nhu cầu thực tế (nếu có) </p><p>4. Xây dựng chức năng lập báo cáo thống kê các số liệu đáp ứng được nhu cầu thực tế (nếu có) </p>', 1.00, 0, '2024-05-10 08:32:44', '2024-05-14 05:21:17', 1, 3, 1),
(31, 7, 15, '<p>1. Tác phong báo cáo: tự tin, giọng nói to, rõ </p><p>2. Lập luận logic, khoa học, đủ nội dung </p><p>3. Tương tác tốt với người nghe (cử chỉ, thái độ cầu thị học hỏi)</p><p>4. Trả lời rõ ràng, thỏa đáng các câu hỏi trọng tâm  </p>', 1.00, 0, '2024-05-10 08:32:48', '2024-05-25 16:24:43', 1, 3, 1),
(34, 7, 15, '<p>1. Sử dụng phần mềm trình chiếu thành thạo, chuyên nghiệp </p><p>2. Sử dụng đa dạng các hình thức trình bày trên slide (sơ đồ, hình ảnh, bảng biểu,....) </p><p>3. Trình bày slide với câu chữ rõ ràng, ngắn gọn, dễ đọc, sử dụng không quá 3 màu chữ trên một slide </p><p>4. Nội dung slide truyền đạt đúng trọng tâm, giúp người xem khái quát được kết quả quá trình thực hiện đồ án/ khóa luận của SV </p>', 1.00, 0, '2024-05-10 08:58:32', '2024-05-25 16:24:43', 1, 7, 1),
