INSERT INTO `subjects` (`subject_id`, `teacher_id`, `subjectName`, `subjectCode`, `description`, `numberCredits`, `numberCreditsTheory`, `numberCreditsPractice`, `typesubject`, `isDelete`, `createdAt`, `updatedAt`) VALUES
(1, 1, 'Khai phá dữ liệu', 'IT31', 'Học phần Khai phá dữ liệu giới thiệu các vấn đề cơ bản của khoa học dữ liệu và các  kỹ thuật khai phá dữ liệu phổ biến. Sinh viên sẽ được rèn luyện các kỹ năng xây dựng mô hình phân lớp, phân cụm, khai thác luật kết hợp trên dữ liệu dạng bảng, dữ liệu log, dữ liệu văn bản bằng ngôn ngữ lập trình Python hoặc R và các công cụ trực quan. Đồng thời môn học cũng rèn luyện thái độ phù hợp khi khai phá dữ liệu và mang đến cho sinh viên góc nhìn đúng đắn về vai trò của khoa học dữ liệu trong bối cảnh hiện đại.', 3, 2, 1, 'Cơ sở ngành', 0, '2024-05-06 18:19:23', '2024-06-24 13:33:00'),
(2, 1, 'Công nghệ phần mềm', 'IT33', 'Môn học cung cấp cho sinh viên những kiến thức chuyên sâu về công nghệ phần mềm hiện đại như phương pháp Agile, phần mềm dựa trên đám mây, kiến trúc microsevices, các kỹ thuật quản lý phiên bản, ảo hóa, tự động hóa và DevOps. Khóa học cũng nhằm tạo cơ hội thực hành các kỹ năng chuyên nghiệp bao gồm thu thập yêu cầu, thiết kế, cài đặt, kiểm thử phần mềm và quản lý dự án phần mềm. Ngoài ra, khóa học phát triển nhận thức và thái độ phù hợp của sinh viên về công nghệ phần mềm cũng như các kỹ năng mềm cần thiết như làm việc nhóm và giao tiếp.', 3, 2, 1, 'Chuyên ngành', 0, '2024-05-06 18:19:23', '2024-06-24 13:32:40'),
(13, 1, 'Thống kê và phân tích dữ liệu', 'IT02', 'Học phần giúp trang bị cho sinh viên các kiến thức cơ bản về xác suất và thống kê để phân tích dữ liệu trong nghiên cứu. Sinh viên sẽ được học cách biên tập dữ liệu, cách mô tả dữ liệu bằng biểu đồ và bằng các đặc trưng thống kê, cách thu thập dữ liệu, thiết kế nghiên cứu và kiểm định các giả thuyết thống kê trên ngôn ngữ Python/R. Nhờ đó sinh viên có thể ứng dụng các kiến thức của môn học để thực hiện các nghiên cứu khoa học và học các môn học có ứng dụng kiến thức thống kê như Trí tuệ nhân tạo, Khai phá dữ liệu… Đồng thời, kỹ năng sử dụng ngôn ngữ Python/R giúp sinh viên có thể dễ dàng tham gia các cộng đồng phân tích số liệu để có thể tự học và nghiên cứu sâu hơn. Học phần cũng giúp sinh viên hình thành thái độ và nhận thức đúng đắn về vai trò của thống kê và khoa học dữ liệu trong bối cảnh hiện đại.', 3, 2, 1, 'Cơ sở ngành', 0, '2024-05-07 15:48:41', '2024-06-24 13:32:07'),
(20, 1, 'Phát triển ứng dụng hướng dịch vụ', 'IT05', 'Môn học hướng dẫn sinh viên phát triển các ứng dụng theo định hướng dịch vụ và triển khai chúng trong môi trường ảo. Sinh viên được cung cấp các kiến thức cơ bản về hệ thống phân tán, mô hình máy khách-máy chủ, kiến trúc hướng dịch vụ và các kỹ thuật phát triển các ứng dụng hướng dịch vụ. Hai mô hình phân tán, dịch vụ web RESTful và Microservices, được giới thiệu để cho phép sinh viên thiết kế và triển khai các ứng dụng phân tán dựa trên hai mô hình này. Học sinh cũng được hướng dẫn cách làm dày các ứng dụng của họ để chạy chúng trong các thùng chứa bằng công nghệ ảo hóa.', 3, 2, 1, 'Cơ sở ngành', 0, '2024-07-09 09:15:04', '2024-07-09 09:41:24'),
(21, 1, 'Cơ sở trí tuệ nhân tạo', 'IT06', 'trang bị cho sinh viên các kiến thức cơ bản về trí tuệ nhân tạo. Môn học bắt đầu bằng giới thiệu những gì mà thế hệ mới nhất của trí tuệ nhân tạo có thể thực hiện, sau đó là các khái niệm và kỹ thuật cơ bản của trí tuệ nhân tạo cũng như các giới hạn của chúng trong các lĩnh vực cụ thể. Đồng thời môn học cũng nhằm rèn luyện cho sinh viên các kỹ năng cài đặt một số ứng dụng máy học và trí tuệ nhân tạo đơn giản và với ngôn ngữ lập trình Python. Môn học cũng giúp hình thành cho sinh viên thái độ và nhận thức đúng đắn về vai trò và các ảnh hưởng của trí tuệ nhân tạo trong các tương lai gần. Các kỹ năng làm việc nhóm, thuyết trình và viết báo cáo cũng được rèn luyện trong môn học.', 3, 2, 1, 'Chuyên ngành', 0, '2024-07-09 09:18:09', '2024-07-09 09:41:40'),
(22, 1, 'Lập trình thiết bị di động', 'IT07', 'Học phần giúp trang bị cho sinh viên các kiến thức chuyên sâu về lập trình cho thiết bị di động. Đồng thời học phần cũng nhằm rèn luyện cho sinh viên các kỹ năng phân tích và thiết kế. Học phần cũng giúp hình thành cho sinh viên thái độ và nhận thức đúng đắn về vai trò của việc lập trình cho thiết bị di động trên các môi trường hệ điều hành khác nhau và kỹ năng làm việc nhóm, viết và trình bày báo cáo.', 3, 2, 1, 'Chuyên ngành', 0, '2024-07-09 09:20:24', '2024-07-09 09:41:50'),
(23, 1, 'Phát triển ứng dụng Web với mã nguồn mở', 'IT08', 'Học phần giúp trang bị cho sinh viên các kiến thức chuyên sâu về lập trình web bằng ngôn ngữ PHP và MySQL. Bên cạnh đó, học phần cũng giúp sinh viên hiểu và ứng dụng được PHP MVC Framework. Đồng thời rèn luyện cho sinh viên các kỹ năng lập trình web theo hướng mã nguồn mở, sử dụng một số PHP framework có sẵn để phát triển ứng dụng web.', 3, 2, 1, 'Chuyên ngành', 0, '2024-07-09 09:29:47', '2024-07-09 09:41:55'),
(24, 1, 'Hệ quản trị cơ sở dữ liệu', 'IT09', ' Môn tiên quyết hoặc song hành: Phân tích, thiết kế hệ thống thông tin, Cấu trúc dữ liệu và giải thuật', 3, 2, 1, 'Chuyên ngành', 0, '2024-07-09 09:30:53', '2024-07-09 09:42:01'),
(25, 1, 'Phân tích thiết kế hệ thống thông tin', 'IT10', 'Môn học giúp trang bị cho sinh viên các kiến thức cơ bản về hệ thống thông tin. Đồng thời môn học cũng nhằm rèn luyện cho sinh viên các kỹ năng phân tích và thiết kế một hệ thống thông tin, cũng như mô hình hóa hệ thống thông tin trên máy tính. Môn học cũng giúp hình thành cho sinh viên thái độ và nhận thức đúng đắn về tầm quan trọng của môn học trong chương trình đào tạo.', 3, 2, 1, 'Cơ sở ngành', 0, '2024-07-09 09:33:26', '2024-07-09 09:42:07'),
(26, 1, 'Quản trị dự án công nghệ thông tin', 'IT11', 'Đồng thời học phần cũng nhằm rèn luyện cho sinh viên các kỹ năng giao tiếp, kỹ năng phác thảo đề cương cho một dự án. Vận dụng phần mềm Microsoft Project để quản lý một dự án.', 3, 2, 1, 'Cơ sở ngành', 0, '2024-07-09 09:34:40', '2024-07-09 09:42:12'),
(27, 1, 'An toàn và Bảo mật thông tin', 'IT12', 'he course provides students with the basics of data security and security; the need for data protection and information security; methods of penetration attacks. Research on symmetric encryption methods and public key infrastructure, digital authentication, and some other security solutions. Students will get hands-on experience with common network services such as DNS, HTTP, firewall.', 3, 2, 1, 'Chuyên ngành', 0, '2024-07-09 09:35:49', '2024-07-09 09:42:20'),
(28, 1, 'Lập trình ứng dụng trên Windows', 'IT13', 'Môn học giúp trang bị cho sinh viên các kiến thức cơ bản về lập trình ứng dụng. Đồng thời môn học cũng nhằm rèn luyện cho sinh viên các kỹ năng tiếp cận và thực hiện dự án phần mềm.  Môn học cũng giúp hình thành cho sinh viên thái độ và nhận thức đúng đắn về nghề nghiệp và kỹ năng làm việc nhóm và giao tiếp.', 3, 2, 1, 'Chuyên ngành', 0, '2024-07-09 09:37:53', '2024-07-09 09:42:25');
